/** @format */

import {
	StyleSheet,
	Text,
	View,
	SafeAreaView,
	StatusBar,
	Image,
	TouchableOpacity,
} from "react-native";
import React, { useState } from "react";
import { CircleButton } from "../components/Button";
import left from "../../assets/icons/left.png";
import sign from "../../assets/icons/logo1.png";

import check from "../../assets/icons/purpletick.png";
import uncheck from "../../assets/icons/search.png";

import HeadingText from "../components/HeadingText";
import Feather from "react-native-vector-icons/Feather";
import GenderCard from "../components/GenderCard";
import Student from "./Student";

const GenderScreen = (props) => {
	const [checked, setChecked] = useState(0);
	var gender = ["Male", "Female"];
	return (
		<SafeAreaView style={styles.container}>
			<View
				style={{
					width: "100%",
					height: 100,
					borderBottomLeftRadius: 20,
					borderBottomRightRadius: 20,
					position: "relative",
				}}>
				<CircleButton
					imgUrl={left}
					handlePress={() => props.navigation.goBack()}
					left={15}
					top={
						Platform.OS === "ios"
							? StatusBar.currentHeight
							: StatusBar.currentHeight - 20
					}
				/>
			</View>
			<View style={{ alignItems: "center" }}>
				<Image
					resizeMode='contain'
					style={{
						width: 80,
						height: 120,
					}}
					source={sign}
				/>
			</View>
			<HeadingText heading='Which one are you?' />
			<View
				style={{
					// width: "100%",
					display: "flex",
					flexDirection: "row",
					justifyContent: "space-around",
				}}>
				<View style={styles.btn}>
					{gender.map((gender, key) => {
						// console.log(key);
						return (
							<View key={gender}>
								{checked == key ? (
									<TouchableOpacity style={styles.btn}>
										<GenderCard
											logoname={"human-" + gender.toLowerCase()}
											gender={gender}
										/>
										<Image style={styles.img} source={check} />
										{/* <Text>{gender}</Text> */}
									</TouchableOpacity>
								) : (
									<TouchableOpacity
										onPress={() => {
											setChecked(key);
										}}
										style={styles.btn}>
										<GenderCard
											logoname={"human-" + gender.toLowerCase()}
											gender={gender}
										/>
										<Image style={styles.img} source={uncheck} />
										{/* <Text>{gender}</Text> */}
									</TouchableOpacity>
								)}
							</View>
						);
					})}
				</View>
			</View>
			<Text style={styles.caption}>
				To give you better experience we {"\n"} need to know your gender
			</Text>
			<View style={{ alignItems: "center" }}>
				<TouchableOpacity
					onPress={async () =>{
						Student.setValue("gender",gender[checked])
						var student = Student.getjsonString()
					    console.log(student)
						const response = await fetch('http://192.168.0.111:3000/student/register', {
							method: 'POST',
							body: student,
							headers: {
								'Content-Type': 'application/json',
								Accept: 'application/json',
							  }
						  });
					
						  if (!response.ok) {
							throw new Error(`Error! status: ${response.status}`);
						//props.navigation.navigate("LoginScreen")
					}
				}}
				
					style={[
						styles.signIn,
						{
							backgroundColor: "#9932cc",
							borderColor: "#9932cc",
							borderWidth: 1,
							marginTop: 15,
						},
					]}>
					<Text
						style={[
							styles.textSign,
							{
								color: "#fff",
							},
						]}>
						Register <Feather name='arrow-right' size={20} />
					</Text>
				</TouchableOpacity>
			</View>

			{/* <Text>{gender[checked]}</Text> */}
		</SafeAreaView>
	);

	// return (
	// 	<SafeAreaView style={styles.container}>

	// 	</SafeAreaView>
	// );
};

export default GenderScreen;

const styles = StyleSheet.create({
	container: {
		flex: 1,
	},
	signIn: {
		width: "50%",
		height: 50,
		justifyContent: "center",
		alignItems: "center",
		borderRadius: 10,
	},
	textSign: {
		fontSize: 18,
		fontWeight: "bold",
	},
	radio: {
		flexDirection: "row",
	},
	img: {
		height: 20,
		width: 20,
		marginHorizontal: 5,
	},
	btn: {
		flexDirection: "row",
		alignItems: "center",
	},
	caption: {
		fontSize: 18,
		color: "grey",
		textAlign: "center",
		padding: 50,
	},
});
